import React from 'react';
import styles from './Event.module.css';

function Event({title, instructor, date, time, image}) {
    console.log(image)
    return (
        <div className={styles.eventContainer}>
            <div style={{backgroundImage: `url(../${image})`}} className={styles.eventImg}></div>
            <div className={styles.eventTitle}></div>
            <div className={styles.eventInstructor}></div>
            <div className={styles.eventDate}></div>
            <div className={styles.eventTime}></div>
        </div>
    )
}

export default Event
